Right board

{Ipse}
enim Pater amat uos q{uia}
uos me amastis et cred{idistis}
{alleluia}

Portion of a parchment leaf from a liturgical ms., probably an antiphonary, containing text and music for the antiphon for the canticle (Magnificat) sung at vespers on <a href="http://divinumofficium.com/cgi-bin/horas/Pofficium.pl?date1=05-30-2011&amp;command=prayVespera&amp;version=Trident 1570&amp;testmode=regular&amp;lang2=English&amp;votive=" rel="nofollow">feria II in Rogationibus</a>. Written in a Gothic bookhand. Text and neumes in dark (now brown?) ink; 4-line staves in red.

